      /** @brief Namespace for implementation details of viennashe::materials::dos_relaxed_silicon. Not of interest for the library user. */
      namespace detail
      {
        /** @brief Interpolates data given at (x0, y1) and (x0+deltaX, y2) */
        inline double interpolate(const double x, const double y1, const double y2, const double deltaX, const double x0)
        {
          // Linear interpolation:
          return y1 + (y2 - y1) / deltaX  * (x - x0);
        }
      }

      /** @brief Convenience function for returning the density of states for carriers in the respective band. */
      inline double get_density_of_states(const double eps, const viennashe::carrier_type_id ctype)
      {
        const double step_size_eV = 1.0e-3; // in eV !!!
        double conversion_prefactor = 1.0 / viennashe::physics::constants::q;
        conversion_prefactor *= (ctype == viennashe::ELECTRON_TYPE_ID) ? (1.0/6.0) : (1.0/4.0); // m^-3 eV^-1 => m^-3 J^-1 without spin and valley degeneracy
        const double energy = viennashe::physics::convert::joule_to_eV(eps);

        const std::size_t bin_no = static_cast<std::size_t>(energy / step_size_eV);

        if (ctype == viennashe::ELECTRON_TYPE_ID)
        {
          const double y1 = viennashe::materials::dos_relaxed_silicon::data::raw_DOS_electrons( bin_no );
          const double y2 = viennashe::materials::dos_relaxed_silicon::data::raw_DOS_electrons( bin_no + 1 );

          return conversion_prefactor * detail::interpolate(energy, y1, y2, step_size_eV, (bin_no * step_size_eV) );
        }
        else
        {
          const double y1 = viennashe::materials::dos_relaxed_silicon::data::raw_DOS_holes( bin_no );
          const double y2 = viennashe::materials::dos_relaxed_silicon::data::raw_DOS_holes( bin_no + 1 );

          return conversion_prefactor * detail::interpolate(energy, y1, y2, step_size_eV, (bin_no * step_size_eV) );
        }
      }

      /** @brief Convenience function for returning the group velocity for carriers in the respective band. */
      inline double get_group_velocity(const double eps, const viennashe::carrier_type_id ctype)
      {
        const double step_size_eV = 1.0e-3; // in eV !!!
        const double conversion_prefactor = 1.0; // m/s
        const double energy = viennashe::physics::convert::joule_to_eV(eps);
        const std::size_t bin_no = static_cast<std::size_t>(energy / step_size_eV);

        if (ctype == viennashe::ELECTRON_TYPE_ID)
        {
          const double y1 = viennashe::materials::dos_relaxed_silicon::data::raw_vg_electrons( bin_no );
          const double y2 = viennashe::materials::dos_relaxed_silicon::data::raw_vg_electrons( bin_no + 1 );

          return conversion_prefactor * detail::interpolate(energy, y1, y2, step_size_eV, (bin_no * step_size_eV) );
        }
        else
        {
          const double y1 = viennashe::materials::dos_relaxed_silicon::data::raw_vg_holes( bin_no );
          const double y2 = viennashe::materials::dos_relaxed_silicon::data::raw_vg_holes( bin_no + 1 );

          return conversion_prefactor * detail::interpolate(energy, y1, y2, step_size_eV, (bin_no * step_size_eV) );
        }
      }

